  );
  event Owner(address indexed owner, bool added);

  mapping(address => bool) public isOwner;

  address[] public owners;

  uint public signaturesRequired;
  uint public nonce;
  uint public chainId;

  modifier onlyOwner() {
    require(isOwner[msg.sender], "Not owner");
    _;
  }

  modifier onlySelf() {
    require(msg.sender == address(this), "Not Self");
    _;
  }

  modifier requireNonZeroSignatures(uint _signaturesRequired) {
    require(_signaturesRequired > 0, "Must be non-zero sigs required");
    _;
  }

  // constructor:
  // emit Owner(owner, isOwner[owner]);

  function addSigner(
    address newSigner,
    uint256 newSignaturesRequired
  ) public onlySelf requireNonZeroSignatures(newSignaturesRequired) {
    require(newSigner != address(0), "addSigner: zero address");
    require(!isOwner[newSigner], "addSigner: owner not unique");

    isOwner[newSigner] = true;
    owners.push(newSigner);
    signaturesRequired = newSignaturesRequired;

    emit Owner(newSigner, isOwner[newSigner]);
    multiSigFactory.emitOwners(address(this), owners, newSignaturesRequired);
  }

  function removeSigner(
    address oldSigner,
    uint256 newSignaturesRequired
  ) public onlySelf requireNonZeroSignatures(newSignaturesRequired) {
    require(isOwner[oldSigner], "removeSigner: not owner");

    _removeOwner(oldSigner);
    signaturesRequired = newSignaturesRequired;

    emit Owner(oldSigner, isOwner[oldSigner]);
    multiSigFactory.emitOwners(address(this), owners, newSignaturesRequired);
  }

  function _removeOwner(address _oldSigner) private {
    isOwner[_oldSigner] = false;
    uint256 ownersLength = owners.length;
    address[] memory poppedOwners = new address[](owners.length);
    for (uint256 i = ownersLength - 1; i >= 0; i--) {
      if (owners[i] != _oldSigner) {
        poppedOwners[i] = owners[i];
        owners.pop();
      } else {
        owners.pop();
        for (uint256 j = i + 1; j <= ownersLength - 1; j++) {
          owners.push(poppedOwners[j]);
        }
        return;
      }
    }
  }

  function updateSignaturesRequired(
    uint256 newSignaturesRequired
  ) public onlySelf requireNonZeroSignatures(newSignaturesRequired) {
    signaturesRequired = newSignaturesRequired;
  }

  function executeTransaction(
    address payable to,
    uint256 value,
    bytes memory data,
    bytes[] memory signatures
  ) public onlyOwner returns (bytes memory) {
    bytes32 _hash = getTransactionHash(nonce, to, value, data);

    nonce++;

    uint256 validSignatures;
    address duplicateGuard;
    for (uint i = 0; i < signatures.length; i++) {
      address recovered = recover(_hash, signatures[i]);
      require(
        recovered > duplicateGuard,
        "executeTransaction: duplicate or unordered signatures"
      );
      duplicateGuard = recovered;

      if (isOwner[recovered]) {
        validSignatures++;
      }
    }

    require(
      validSignatures >= signaturesRequired,
      "executeTransaction: not enough valid signatures"
    );

    (bool success, bytes memory result) = to.call{value: value}(data);
    require(success, "executeTransaction: tx failed");

    emit ExecuteTransaction(
      msg.sender,
      to,
      value,
      data,
      nonce - 1,
      _hash,
      result
    );
    return result;
  }

  function getTransactionHash(
    uint256 _nonce,
    address to,
    uint256 value,
    bytes memory data
  ) public view returns (bytes32) {
    return
      keccak256(
        abi.encodePacked(address(this), chainId, _nonce, to, value, data)
      );
  }

  function recover(
    bytes32 _hash,
    bytes memory _signature
  ) public pure returns (address) {
    return _hash.toEthSignedMessageHash().recover(_signature);
  }

  receive() external payable {
    emit Deposit(msg.sender, msg.value, address(this).balance);
  }
}

